window.bookSummaryJSON = "<p>Earth’s greatest protection will become its biggest threat.</p> <p>When the Confederation gathers a grand armada ostensibly to liberate Earth from the Boxans, the crew of the Athena must stop them before it’s too late.</p> <p>Some species believe they can avoid war and endure the oppression of the Confederation while others choose to resist. The Athena and her crew struggle to keep the Star Alliance from splintering apart by offering them something unthinkable. </p> <p><i>Ascension</i> is the final book in the Ascension series, an action-packed space opera saga that spans worlds. A journey that began when the brave crew of the Athena left Earth to investigate an alien structure discovered in the furthest reaches of the solar system will now come to an end.</p>"; 
